import { useNavigate } from 'react-router-dom';

/**
 * 
 * @param {*} Component 
 * @returns 
 */
export const Navigation = (Component) => {
  const Wrapper = (props) => {
    const navigate = useNavigate();
    
    return (
      <Component
        navigate={navigate}
        {...props}
        />
    );
  };
  
  return Wrapper;
};
